import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <label id='label_sex' >Sex</label>
      <input id='sex' for='label_sex' >Sex</input>
      <label id='label_age' >Age</label>
      <label id='label_bmi' >BMI</label>
      <label id='label_weight' >weight</label>
      <label id='label_height' >Height</label>
      <label id='label_initialo2' >O2</label>
      <label id='label_initialhr' >Heart Rate</label>
      <label id='label_initialrr' >Respiratory Rate</label>
    </div>
  );
}

export default App;
